<ion-content>
  <div id="curtain">
    <span></span>
    <span></span>
    <span></span>
    <div id="bg" class="animated"></div>
    <div id="redondosd" class="redondo2 animated">
      <ion-icon name="checkmark"></ion-icon>
      <p class="dato">{{ datas.corrects }}</p>
      <div id="question">
      {{ question.question }}
      </div>
      <ion-icon name="close"></ion-icon>
      <p class="dato2">{{ datas.incorrects }}</p>
    </div>
    <div class="redondo">
      <ion-icon name="home" routerLink="/canary-h"></ion-icon>
      <h1>Triana</h1>
      <p>1 / 3</p>
    </div>
    <div *ngIf="isLastQuestion; then thenBlock else elseBlock"></div>
    <ng-template #thenBlock>
      <ion-button class="buttonOption animated" id="option1" (click)="goEndGame($event, answers[0].correct)">{{ answers[0].answer }}</ion-button>
      <ion-button class="buttonOption animated" id="option2" (click)="goEndGame($event, answers[1].correct)">{{ answers[1].answer }}</ion-button>
      <ion-button class="buttonOption animated" id="option3" (click)="goEndGame($event, answers[2].correct)">{{ answers[2].answer }}</ion-button>
      <ion-button class="buttonOption animated" id="option4" (click)="goEndGame($event, answers[3].correct)">{{ answers[3].answer }}</ion-button>
    </ng-template>
    <ng-template #elseBlock>
      <ion-button class="buttonOption animated" id="option1" (click)="nextQuestion($event, answers[0].correct)">{{ answers[0].answer }}</ion-button>
      <ion-button class="buttonOption animated" id="option2" (click)="nextQuestion($event, answers[1].correct)">{{ answers[1].answer }}</ion-button>
      <ion-button class="buttonOption animated" id="option3" (click)="nextQuestion($event, answers[2].correct)">{{ answers[2].answer }}</ion-button>
      <ion-button class="buttonOption animated" id="option4" (click)="nextQuestion($event, answers[3].correct)">{{ answers[3].answer }}</ion-button>
    </ng-template>
